let requesttranslator = [{
    id: 1,
    name: "Disaster distress Helpline",
    // number: 1995,
    // amount: "$10,800",
    // due: "12/05/1995"
},
{
    id: 2,
    name: "Request for translaation of book",
},
{
    id: 3,
    name: "Request a face to face sign language translation",
},
{
    id: 4,
    name: "Request a sign lnguage translation online",
}
]

export function getRequesttranslator() {
    return requesttranslator;
}
